CREATE TABLE LoanApplications
  (
    INSEE           NUMBER (15) NOT NULL,
    FirstName       VARCHAR2 (15) NOT NULL,
    LastName        VARCHAR2 (20) NOT NULL,
    Street          VARCHAR2 (50) NOT NULL,
    City            VARCHAR2 (15) NOT NULL,
    PostalCode      NUMBER (5) NOT NULL,
    Country         VARCHAR2 (20) NOT NULL,
    Phone           NUMBER (12) NOT NULL,
    Email           VARCHAR2 (50) NOT NULL,
    Birthday        DATE NOT NULL,
    ApplicationDate DATE NOT NULL,
    Accepted        NUMBER (1),
    AmountAwarded   NUMBER (7,2),
    CheckSent       NUMBER (1) NOT NULL,
    SchoolAttending NUMBER (6) NOT NULL,
    PayStub1        BLOB NOT NULL,
    PayStub2        BLOB NOT NULL,
    PayStub3        BLOB NOT NULL,
    PassportNumber  VARCHAR (30)
  ) ;
ALTER TABLE LoanApplications ADD CONSTRAINT LoanApplications_PK PRIMARY KEY ( INSEE ) ;

CREATE TABLE LoanApplicationsHistory
  (
    INSEE           NUMBER (15) NOT NULL,
    BackupDate	    DATE NOT NULL,
    FirstName       VARCHAR2 (15) NOT NULL,
    LastName        VARCHAR2 (20) NOT NULL,
    Street          VARCHAR2 (50) NOT NULL,
    City            VARCHAR2 (15) NOT NULL,
    PostalCode      NUMBER (5) NOT NULL,
    Country         VARCHAR2 (20) NOT NULL,
    Phone           NUMBER (12) NOT NULL,
    Email           VARCHAR2 (50) NOT NULL,
    Birthday        DATE NOT NULL,
    ApplicationDate DATE NOT NULL,
    Accepted        NUMBER (1),
    AmountAwarded   NUMBER (7,2),
    CheckSent       NUMBER (1) NOT NULL,
    SchoolAttending NUMBER (6) NOT NULL,
    PayStub1        BLOB NOT NULL,
    PayStub2        BLOB NOT NULL,
    PayStub3        BLOB NOT NULL,
    PassportNumber  VARCHAR (30)
  ) ;
ALTER TABLE LoanApplicationsHistory ADD CONSTRAINT LoanApplicationsHistory_PK PRIMARY KEY ( INSEE,BackupDate ) ;


CREATE TABLE SchoolsAttended
  (
    INSEE                   NUMBER (15) NOT NULL,
    IntentifierCode         NUMBER (6) NOT NULL ,
    BeginDate               DATE NOT NULL ,
    EndDate                 DATE NOT NULL
  ) ;
ALTER TABLE SchoolsAttended ADD CONSTRAINT SchoolsAttended_PK PRIMARY KEY ( INSEE,IntentifierCode,BeginDate,EndDate ) ;


CREATE TABLE Schools
  (
    IntentifierCode   NUMBER (6) NOT NULL ,
    SchoolName        VARCHAR2 (50) NOT NULL,
    Street            VARCHAR2 (50) NOT NULL,
    City              VARCHAR2 (15) NOT NULL,
    PostalCode        NUMBER (5) NOT NULL,
    Country           VARCHAR2 (20) NOT NULL,
    ContactPhone      NUMBER (12),
    ContactEmail      VARCHAR2 (50)
  ) ;
ALTER TABLE Schools ADD CONSTRAINT Schools_PK PRIMARY KEY ( IntentifierCode ) ;

CREATE TABLE SchoolsImport
  (
    IntentifierCode   NUMBER (6) NOT NULL ,
    INSEE             NUMBER (15) NOT NULL,
    PassportNumber    VARCHAR (30) NOT NULL
  ) ;
ALTER TABLE SchoolsImport ADD CONSTRAINT SchoolsImport_PK PRIMARY KEY ( INSEE,IntentifierCode ) ;

ALTER TABLE LoanApplications ADD CONSTRAINT LoanApplications_Schools_FK FOREIGN KEY ( SchoolAttending ) REFERENCES Schools ( IntentifierCode ) ;
ALTER TABLE SchoolsAttended ADD CONSTRAINT SchoolsAttended_Schools_FK FOREIGN KEY ( IntentifierCode ) REFERENCES Schools ( IntentifierCode ) ;
ALTER TABLE SchoolsAttended ADD CONSTRAINT SchoolsAttended_LoanApps_FK FOREIGN KEY ( INSEE ) REFERENCES LoanApplications ( INSEE ) ON DELETE CASCADE ;
ALTER TABLE SchoolsImport ADD CONSTRAINT SchoolsImport_Schools_FK FOREIGN KEY ( IntentifierCode ) REFERENCES Schools ( IntentifierCode ) ;

